import "../app.css";
import React from "react";

const Habit = ({ habit, onIncrement, onDecrement, onDelete }) => {
	// const handleIncrement = () => {
	// 	props.onIncrement(props.habit);
	// };
	// const handleDecrement = () => {
	// 	props.onDecrement(props.habit);
	// };
	// const handleDelete = () => {
	// 	props.onDelete(props.habit);
	// };
	// const { name, count } = props.habit;
	return (
		<li className="habit">
			<span className="habit-name">{habit.name}</span>
			<span className="habit-count">{habit.count}</span>
			<button className="habit-button habit-increase" onClick={onIncrement}>
				<i className="fas fa-plus-square"></i>
			</button>
			<button className="habit-button habit-decrease" onClick={onDecrement}>
				<i className="fas fa-minus-square"></i>
			</button>
			<button className="habit-button habit-delete" onClick={onDelete}>
				<i className="fas fa-trash"></i>
			</button>
		</li>
	);
};

export default Habit;
